import React from 'react';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { OnGoing, Cart, Home, Login, LoginPassword, MenuDetail, MenuOverview, Payment, Profile, ScanQR, Signin } from './screens';
import {Boxes, Buttons, Categories, Header, Navigation, Popups} from './components'
import './App.css';

const App = () => {
  return (
    <Router>

      <Routes>
        <Route path="/home" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/login-password" element={<LoginPassword />} />
        <Route path="/payment" element={<Payment />} />
        <Route path="/scanqr" element={<ScanQR />} />
        <Route path="/menu-detail" element={<MenuDetail />} />
        <Route path="/menu-overview" element={<MenuOverview />} />
        <Route path="/cart" element={<Cart />} />
      </Routes>
      <Navigation />
    </Router>
  );
};

export default App;
